import './FaceRecognition.css'

const FaceRecognition = ({imageUrl}) => {
    return (
        <div className='center ma'>
            <div className='absolute mt'>
            <img width='500px' height='auto'
                id='inputimage' alt='' src={imageUrl}/>
            </div>
        </div>
    )
}

export default FaceRecognition
